SimpleWalkCalculator[Braid_Knot, NCvars_, q_] := 
   SimpleWalkCalculator[Array[{Abs[BR[Braid][[2]][[#1]]], 
       Sign[BR[Braid][[2]][[#1]]]} & , Length[BR[Braid][[2]]]], NCvars, q]
 
SimpleWalkCalculator[Braid_BR, NCvars_, q_] := SimpleWalkCalculator[
    Array[{Abs[Braid[[2]][[#1]]], Sign[Braid[[2]][[#1]]]} & , 
     Length[BR[Braid][[2]]]], NCvars, q]
 
SimpleWalkCalculator[brd_, NCvars_, q_] := 
   SimpleWalkCalculator[brd, NCvars, q] = 
    Module[{simpleWalks, Ncrs = Length[brd], ncvLen = Length[NCvars] + 1}, 
     simpleWalks = NCToNCPoly[NCExpand[CEE[q, SSubMatrices[
           RBrep[q, Brep[brd, NCvars]]]]], NCvars]; 
      Do[simpleWalks[[2]] = Association[DeleteCases[Normal[simpleWalks[[2]]], 
           HoldPattern[keys_List -> _] /; keys[[ncvLen - i - 2*Ncrs]] + keys[[
                ncvLen - i - Ncrs]] > 1 || keys[[ncvLen - i - 2*Ncrs]] + 
               keys[[ncvLen - i]] > 1]]; If[simpleWalks == 0, Break[]], 
       {i, 1, Ncrs}]; Return[simpleWalks]]
